import { Link } from "react-router-dom";
import styled from "styled-components";
import Acount from "./Acount";


export default function MainPage() {


    return (
        <>
        <Header>
            <span>Olá, Fulano</span>
            <ion-icon name="exit-outline"></ion-icon>
        </Header>
        <Content>
            {/* <h2>Não há registros de </h2><h2>entrada ou saída</h2> */}
            <Acount />
            <Acount />
            <Acount />
            <Acount />
            <Acount />
            <Total>
                <span>Saldo</span>
                <span>2849,96</span>
            </Total>
        </Content>
        <Buttons>
            <Link to="/input">
            <Box>
                <ion-icon name="add-circle-outline"></ion-icon>
                <span>Nova entrada</span>
            </Box>
            </Link>
            <Link to="output">
                <Box>
                    <ion-icon name="remove-circle-outline"></ion-icon>
                    <span>Nova saída</span>
                </Box>
            </Link>
        </Buttons>
        </>
    );
}
const Header = styled.div`
    width: 326px;
    display: flex;
    align-items: center;
    justify-content: space-between;
    font-size: 24px;
    color: #FFFFFF;
    font-family: 'Raleway';
    font-weight: bold;
    margin-bottom: 15px;

    ion-icon {
        font-size: 30px;
    }
`
const Content = styled.div`
    width: 326px;
    height: 446px;
    background-color: #FFFFFF;
    border-radius: 5px;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    flex-wrap: wrap;
    h2 {
        font-family: 'Raleway';
        font-size: 20px;
        color: #868686;
    }
`
const Buttons = styled.div`
    width: 326px;
    display: flex;
    margin-top: 15px;
    justify-content: space-between;
    a {
        text-decoration: none;
    }
`
const Box = styled.div`
    width: 155px;
    height: 114px;
    border-radius: 5px;
    background-color: #A328D6;
    color: #FFFFFF;
    display: flex;
    flex-direction: column;
    padding-left: 8px;
    justify-content: space-around;
    span {
        display: inline-block;
        width: 64px;
        font-family: 'Raleway';
        font-size: 18px;
        font-weight: bolder;
    }
    ion-icon {
        font-size: 28px;
    }
`
const Total = styled.div`
    width: 100%;
    display: flex;
    justify-content: space-between;
    span:first-child {
        font-size: 20px;
        font-weight: bold;
        font-family: 'Raleway';

    }


`
